import React, { Component } from "react";
import { Card, Row, Col } from "antd";

class OrderBook extends Component {
	state = { buyOrderEvents: [], newcount: 0 };
	componentDidMount = async () => {
		const { drizzle, drizzleState } = this.props;
		// const buyOrders = drizzle.contracts.CelebrityExchange.methods.buyOrders.cacheCall(
		// 	0
		// );
		// this.setState({ buyOrders });
		// if (this.state.buyOrders !== []) {
		// 	// buyOrders.filter((status) => 0);
		// 	this.setState({ buyOrders });
		// 	console.log(buyOrders);
		// }
		let buyOrders = [];
		let buyOrderCount = await drizzle.contracts.CelebrityExchange.methods[
			"buyOrderCount"
		].cacheCall();

		this.setState({
			buyOrders,
			buyOrderCount,
		});
		this.setState({
			newcount:
				drizzleState.contracts.CelebrityExchange.buyOrderCount[
					this.state.buyOrderCount
				] &&
				drizzleState.contracts.CelebrityExchange.buyOrderCount[
					this.state.buyOrderCount
				].value,
		});

		for (let i = 0; i < (buyOrderCount && buyOrderCount.value); i++) {
			buyOrders.push(
				drizzle.contracts.CelebrityExchange.methods["buyOrders"].cacheCall(i)
			);
		}
		let buyOrderEvents = drizzleState.contracts.CelebrityExchange.events;
		this.setState({ buyOrderEvents });

		console.log(this.state.buyOrderEvents);
		// const buyOrderEventsFiltered = buyOrderEvents.filter(
		// 	(buyOrderEvent) => buyOrderEvent.event === "BuyOrderPlaced"
		// );
		// this.setState({ buyOrderEventsFiltered });
		// console.log(this.state.buyOrderEventsFiltered);
	};
	setValues = () => {
		const { drizzle, drizzleState } = this.props;
		let buyOrderEvents = drizzleState.contracts.CelebrityExchange.events;
		this.setState({ buyOrderEvents });
	};
	render() {
		return (
			<div className="">
				<Card className="orderBook">
					<Row>
						<Col span="12">
							<p
								style={{
									textAlign: "center",
									color: "white",
									fontSize: "12",
								}}
							>
								Open Buy Orders
							</p>
							<table style={{ width: "95%", textAlign: "right" }}>
								<thead>
									<tr>
										<th>Volume</th>
										<th>Buy Price</th>
									</tr>
								</thead>
								<tbody>
									<tr>
										<td>1000</td>
										<td style={{ color: "#55bd6c" }}>0.0034</td>
									</tr>
									<tr>
										<td>500</td>
										<td style={{ color: "#55bd6c" }}>0.0032</td>
									</tr>
								</tbody>
							</table>
						</Col>
						<Col span="12">
							<p
								style={{
									textAlign: "center",
									color: "white",
									fontSize: "12",
								}}
							>
								Open Sell Orders
							</p>
							<table style={{ width: "100%" }}>
								<thead>
									<tr>
										<th>Sell Price</th>
										<th>Volume</th>
									</tr>
								</thead>
								<tbody>
									<tr>
										<td style={{ color: "#f1432f" }}>0.0035</td>
										<td>1200</td>
									</tr>
									<tr>
										<td style={{ color: "#f1432f" }}>0.0040</td>
										<td>120</td>
									</tr>
								</tbody>
							</table>
						</Col>
					</Row>
					{() => this.setValues()}
				</Card>
			</div>
		);
	}
}

export default OrderBook;
